import React, { useEffect, useState } from "react";
import Item from "./DisplayTeddies";
import axios from "axios";

const URL = "http://localhost:5000/items"; // Fixed URL

const fetchHandler = async () => {
    try {
        const response = await axios.get(URL);
        return response.data;
    } catch (error) {
        console.error("Error fetching data:", error);
        return { items: [] }; // Return an empty array if there's an error
    }
};

function TeddyBares(props) {
    const { itemname, getprice, sellprice, pieces, date } = props.item || {}; // Destructure properly and handle default value

    const [items, setItems] = useState([]);

    useEffect(() => {
        fetchHandler().then((data) => setItems(data.items || [])); // Handle cases where data.items might be undefined
    }, []);

    return (
        <div>
            <div>
                {items.map((item, i) => (
                    <div key={i}>
                        <Item item={item} />
                    </div>
                ))}
            </div>
            <h1>{itemname}</h1>
            <h1>{getprice}</h1>
            <h1>{sellprice}</h1>
            <h1>{pieces}</h1>
            <h1>{date}</h1>
        </div>
    );
}

export default TeddyBares;
